import pflText from "../Assets/text.png";
import "./schedule.css";
import logo1 from "../Assets/akela.PNG";
import logo2 from "../Assets/ceros.PNG";
import logo3 from "../Assets/grizzly.PNG";
import logo4 from "../Assets/hydra.PNG";
import logo5 from "../Assets/raptors.PNG";
import logo6 from "../Assets/stags.PNG";
import logo7 from "../Assets/tusker.PNG";
import logo8 from "../Assets/valiente.PNG";
import logo9 from "../Assets/football.png"
export default function Create() {
  return (
    <div>
      <img
        src={pflText}
        alt="Logo"
        style={{
          display: "block",
          margin: "auto",
          width: "300px",
          marginTop: "20px",
        }}
      />
      <div
        style={{
          display: "flex",
          justifyContent: "center",
          alignItems: "center",
        }}
      >
        <h1
          style={{
            marginTop: "40px",
            backgroundColor: "#138ce8",
            width: "300px",
            textAlign: "center",
            height: "70px",
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          }}
        >
          Group Matches
        </h1>
      </div>

      <div
        style={{ display: "flex", justifyContent: "center", marginTop: "30px" }}
      >
        <div className="home-club">
          <img
            src={logo1}
            style={{
              width: "80px",
              backgroundColor: "#6b2e7d",
              borderRadius: "20px",
              padding: "5px",
            }}
            alt="Logo"
          />
          <p>Akela</p>
          <img
            src={logo9}
            style={{
              width: "70px",
              margin: "40px"
            }}
            alt="Logo"
          />
        </div>
        <h1>V</h1>
        <div
          className="away-club"
          style={{ display: "flex", justifyContent: "flex-end" }}
        >
          <p>Ceros</p>
          <img
            src={logo2}
            style={{
              width: "80px",
              backgroundColor: "#34ed5c",
              borderRadius: "20px",
              padding: "5px",
            }}
            alt="Logo"
          />
        </div>
      </div>
    </div>
  );
}

